import React from 'react'
import Home from './components/Home';
import './Contact.scss';
import { BrowserRouter as Router, Routes, Route} from 'react-router-dom';

function Contact() {
    return (
    <Router>
        <div className='App'>
            <div className='content'>
        <Routes>
            <Route path="/">
            <Home />
            </Route>
        </Routes>
        </div>
        </div>
    </Router>
    )
}

export default Contact
